We’re serving Studio 54 🪩 vibes for this year’s Sagittarius ENERGY 12/18 from 4-9pm. It’s giving disco, opulence, luxury, and bold queerness all night long ✨You know every year we go hard for Sagittarius season in honor of our cofounder, and this year we added another Sag baddie to the bunch! 

@tori_the_creator7 is spinning along with your favorite Sags @khalimelon @djdapper_chicago & @followmyque_ will be celebrating all of their birthdays, so make sure you stretch and hydrate because they’re ready to give you a party you won’t forget ‼️ Bring a friend and bring some dollars because the gogo dancers are always on point- @mochamocha2.0 hits the stage with @thatgirlfierce, along with a special music performance by @shegoturbo for the city’s favorite Party for Queers and Their Fam. 

Grab your tickets now at the link in bio before prices go up! 🎟️
